import { library } from '@fortawesome/fontawesome-svg-core';
import React from 'react';
import LibrarySong from './LibrarySong';

const Library = ({songs}) => {
    return(
        <div className="Library">
            <h2>Library</h2>
            <div className="library-songs">
                {songs.map(song => 
                    <LibrarySong />
                )}
            </div>
        </div>
    )
}

export default library;
